import Row from "./Row";

export default function Table({ items, renderHeader }) {
  return (
    <table>
      {renderHeader()}
      <tbody>
        {items.map(item => (
          <Row human={item} key={`${item.id}:${item.firstName}-${item.lastName}`} />
        ))}
      </tbody>
    </table>
  );
}
